import React, {useState, useEffect} from 'react' 

function App() {

  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("/member").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  })
  return (
    <div className="App">
      <p>Hello World</p>
    </div>
  );
}

export default App;
